function expandContract(e){const t=e.closest(".col-xl-3").querySelector(".expand-container");t.classList.contains("collapsed")?(t.classList.remove("collapsed"),t.classList.add("expanded")):(t.classList.remove("expanded"),t.classList.add("collapsed"))}function expandContract_1(e){const t=e.closest(".row").nextElementSibling;t.classList.contains("expanded")?t.classList.remove("expanded"):t.classList.add("expanded")}function toggleCollapse(e){const t=e.closest("ul"),s=e.parentElement.classList.toggle("collapsed"),n=Array.from(t.children);for(let t=n.indexOf(e.parentElement)+1;t<n.length;t++)n[t].style.display=s?"none":"list-item"}document.querySelectorAll(".header-toggle").forEach((e=>{e.addEventListener("click",(function(){toggleCollapse(this)}))}));const sliders=document.getElementsByClassName("my_input");for(let e of sliders){const t=e.min,s=e.max,n=e.value;e.style.background=`linear-gradient(to right, #FE4A01FF 0%, #FE4A01FF ${(n-t)/(s-t)*100}%, #DEE2E6 ${(n-t)/(s-t)*100}%, #DEE2E6 100%)`,e.oninput=function(){this.style.background=`linear-gradient(to right, #FE4A01FF 0%, #FE4A01FF ${(this.value-this.min)/(this.max-this.min)*100}%, #DEE2E6 ${(this.value-this.min)/(this.max-this.min)*100}%, #DEE2E6 100%)`}}